Window Position Callback The window position callback is called when the window is being moved; The IWindow::Window& argument is the window that called the callback. The first int64_t argument is the new x position of the window. The second int64_t argument is the new y position of the window. The internal x and y position will be automatically updated. So there is no need to call window.SetPosition on the window. To register a window position callback, call window.SetPosCallback(callback). Where window is a IWindow::Window. An example of a window position callback is: void WindowPosCallback(IWindow::Window& window, int64_t x, int64_t y) { std::cout << "Window position: " << x << ", " << y << '\n';
} ... // IWindow::Window
window.SetPosCallback(WindowPosCallback); Window Size Callback The window size callback is called when the window is being resized; The IWindow::Window& argument is the window that called the callback. The first int64_t argument is the new width position of the window. The second int64_t argument is the new height position of the window. The internal width and height position will be automatically updated. So there is no need to call window.SetSize on the window. To register a window size callback, call window.SetSizeCallback(callback). Where window is a IWindow::Window. An example of a window size callback is: void WindowSizeCallback(IWindow::Window& window, int64_t width, int64_t height) { std::cout << "Window size: " << width << ", " << height << '\n';
} ... // window is a IWindow::Window
window.SetSizeCallback(WindowPosCallback);

