} An example of a `WindowPosCallback` is
```cpp
#include <iostream> // For std::cout void WindowPosCallback(IWindow::Window& window, int64_t x, int64_t y) { std::cout << "Window position: " << x << ", " << y << '\n';
} x and y are the x and y coordinates of the window. void IWindow::Window::SetUserPointer(void* ptr) sets an internal pointer that can be retreived in a callback or some where else. int main() { ... int example = 10; // window = IWindow::Window window.SetUserPointer(&example); window.SetPosCallback(WindowPosCallback); ...
